&quot;The drama continues in the third episode of Lesbian Chronicles, as Nica opens an all-female massage parlor with her inheritance money. The only problem is, Nica suspects the masseuses are doing more than just working out kinks. Will Nica find out why Trinity's sessions are so popular with rich client Stephanie Swift? What does young Annabelle have in mind for nervous first-timer Mia Lelani? Nica devises a plan with Jessica Bangkok to find out what her naughty employees are up to, but not before her own encounter with the strangely familiar Satine Phoenix. Written and directed by Nica Noelle.&quot;

